'use strict';

const _ = require('lodash');

module.exports = function () {

  const env = _.find(process.argv, (arg) => arg.match(/(env=)\w+/g));

  if (env) {
    process.env.NODE_ENV = env.replace('env=', '');
  }

  return process.env.NODE_ENV || 'development';

};
